import React from "react";
import { observer } from "mobx-react-lite";

function MainPage() {
  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <h1>Полина Мальцева</h1>
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
        }}
      >
        <h3>Ведущий эксперт в теме школьного образования</h3>
      </div>
      <div>
        Помогаю родителям и&nbsp;школам выстраивать траекторию обучения
        и&nbsp;развития детей{"\n"}
          {"\n"}—&nbsp;Руководила проектом создания
        школы «Летово» {"\n"}—&nbsp;Возглавляю социальную инфраструктуру
        г.&nbsp;Доброград, в&nbsp;котором в&nbsp;2021 была открыта школа «Мир»{" "}
        {"\n"}—Работала в&nbsp;Департаменте образования г.&nbsp;Сан-Франциско{" "}
        {"\n"}—&nbsp;Имею 4 высших образования, в&nbsp;том числе Harvard
        Business School (MBA){"\n"}
      </div>
    </div>
  );
}

export default observer(MainPage);
